const React = require("react")
const axios = require("axios")

export default All_data = () => {

    // api database

    const [api, setApi] = useState([]);

    useEffect(() => {
        axios
            .get("http://localhost:3300/realtime_db")
            .then((res) => {
                setApi(res.data)
                // console.log(res.data)
            });
    }, []);
    console.log(api)
    return api
}
